import React from 'react';

const Home = (props) => {
    const getHello= () =>{
        var myHeaders = new Headers();
    myHeaders.append("Authorization", 'Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ0b2tlbl90eXBlIjoiYWNjZXNzIiwiZXhwIjoxNjEwMzQ1OTgxLCJqdGkiOiI4ZWYyODNhYWRmZTE0OWZkYjEzYTZiYTEyYjIxOWYwOCIsInVzZXJfaWQiOjF9.94gAQSXx77suPsy68CWzoHSDq2oHTUkJiK_TqyQ707k');
    alert(myHeaders.get('Authorization'));
    var raw = "";

    var requestOptions = {
    method: 'GET',
    headers: myHeaders,
    body: raw,
    redirect: 'follow'
    };

    fetch("http://127.0.0.1:8000/user/hello/", requestOptions)
    .then(response => response.json())
    .then(result => console.log(result))
    .catch(error => console.log('error', error));
    }
    return(
        <>
            {
                localStorage.getItem('access_token')
            }
            <button onClick={getHello}>요청</button>
            <div>
                홈페이지
            </div>
        </>
    )
};

export default Home;
